## User interface ### Tool windows
In Altaxo there are 6 tool windows:
- The project explorer - The file explorer - Data reader - Output pane - Notes - Lighting (for 3D scenes)
Usually, project explorer and files explorer are docked to the left or right side of the application window. Data reader, output pane and notes pane are docked either to the top or bottom of the application window. The standard configuration is shown in the following figure, with project and file explorer docked to the right; and data reader, output pane and notes pane docked to the bottom.
![](local:BDF48E40DC9D64B05F5C79DD725E208C "Man_UI_DocWindows_Fig010.png"){width=15cm}
As you can see, the project explorer and notes pane are visible, whereas file explorer, output pane and notes pane are invisible (only their tab is shown). To make those tool windows visible, click on the corresponding tool window tab.
#### Making a tool window visible
![](local:7F8CB456F5D14ECD378ED8D6A925461E "Man_UI_ToolWindows_Fig020.png"){width=15cm}
If no or not all of the tool windows are visible at all, as is the case in the figure above, you can make them visible by clicking on the view menu, and then choosing the tool window of your choice, or use the designated keyboard shortcuts.
#### Changing the place of a tool window
You can drag the tool windows around and dock them to new places. There are two methods to do that:
1. Dragging on the title bar will drag the whole tool window group (in the following figure this is the project explorer and the file explorer) around.
![](local:DB6BCD133FE0B03BBA3CE8C703C08FF7 "fig:Man_UI_ToolWindows_Fig030.png"){width=15cm} ![](local:71EE6ED245E6194A4901619BB3A94E89 "fig:Man_UI_ToolWindows_Fig040.png"){width=15cm}
In the figure above, you can see that I'm dragging both the project explorer and the file explorer.
2. On the other hand, if you drag the tab of the project explorer, as it is shown in the next figure, you will only drag the project explorer, but leave the file explorer in place.
![](local:F129D47DCF40373C8A5E0D0FAF5891B9 "fig:Man_UI_ToolWindows_Fig050.png"){width=15cm} ![](local:DC4743B98869667A18E0D04BA2F1D909 "fig:Man_UI_ToolWindows_Fig060.png"){width=15cm}
Feel free to play around to get acquainted with the concept. You can even use the special tool window menu (see next figure) to make the window float, or to dock the tool window in the document area.
![](local:641DC9D26820D6726787695E78F45DF9 "Man_UI_ToolWindows_Fig070.png"){width=15cm}
#### Hiding a tool window
If you want to permanently hide a tool window, click on the close button in the upper right corner of the tool window. To hide the tool window only temporarily, click on the pin symbol just aside. This will shrink the tool window group as shown in the next figure.
![](local:57248FB77E066FF19F91CE0C9EC10BC2 "Man_UI_ToolWindows_Fig080.png"){width=15cm}
### Document windows
The area that is not occupied by the tool windows is the document window area. Usually, it contains one or multiple document windows.
At the time of writing, there are two different kind of document windows:
- Worksheet views - Graph view
![](local:BDF48E40DC9D64B05F5C79DD725E208C "Man_UI_DocWindows_Fig010.png"){width=15cm}
In the figure above, the document area is populated with one worksheet (WT1) and some graphs (GColeAll, GVFTH, GCole5, etc.). The worksheet WT1 is the active document, as indicated by the bold lettering in its tab. If you click on the tab named GColeAll, the graph GColeAll becomes the active document (see figure below).
![](local:CFC59B0CCE1C747AB8167C9AB70EFC0E "Man_UI_DocWindows_Fig020.png"){width=15cm}
Note that when changing from a worksheet to a graph some of the toolbar items are grayed out, and others become active. Moreover, if you right-click on the active tab, you will see context menu items for the worksheet (if the tab belongs to a worksheet, as can be seen in the next figure).
![](local:0CD2A31381F6A7E74CCF217F84ABAF25 "Man_UI_DocWindows_Fig030.png"){width=15cm}
Alternatively, if you right-click on a tab that belongs to a graph, you will see context menu items for the graph (see figure below).
![](local:4053AE5A10111F0B1A07EC08C9063325 "Man_UI_DocWindows_Fig040.png"){width=15cm}
#### Showing multiple documents side-by-side
You can drag document windows around and dock them to other positions.
![](local:6CFEA66E129F6767BD82C470CB9B4619 "Man_UI_DocWindows_Fig050.png"){width=15cm}
![](local:69B06E46B1D008FC69A6459E28195C37 "Man_UI_DocWindows_Fig060.png"){width=15cm}
#### Using floating windows
By left-clicking on a document tab, and dragging while holding the left mouse button pressed, you can drag the document window to other positions on the desktop, even to another screen. In the next figure, I have dragged the graph document GColeAll to the right of the main application window.
![](local:1E1F3846C4A71126F71E355F9C694EF1 "Man_UI_DocWindows_Fig070.png"){width=15cm}
